import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import Navigation from "../Component/Navigation";
import "./Style.css"

const About = () => {
  return (
    <>
      <Row>
        <Navigation />
      </Row>
      <Row>
        <Col className="about-background">
          <Container>
            <Row> Name - Aatish</Row>
            <Row>
                <Col>Contact Us</Col>
                
            </Row>
          </Container>
        </Col>
      </Row>
    </>
  );
};
export default About;
